import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Tâches</h1>
      <p>Planifiez votre journée en détails</p>
      <div style={{ display: "flex", flexDirection: "column", gap: "10px" }}>
        <Link to="/tasks">
          <button style={{ padding: '10px 20px', fontSize: '16px' }}>Voir les Tâches</button>
        </Link>
        <Link to="/about">
          <button style={{ padding: '10px 20px', fontSize: '16px' }}>Voir À propos</button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
